import React from 'react';
import "./App.scss"
import Myprofile from './components/Myprofile';
export default function App() {
  return (
    <div>
       <div className='base'>
        <div className='profile'>
          <Myprofile />
        </div>
        <div className='right-side'>
          <div className="top-bar">

          </div>
          <div className='main-content'></div>
        </div>
       </div>
    </div>
  );
}
